 import  Product1  from "./../products/product-1.jpg"
 import  Product2  from "./../products/product-2.jpg"
 import  Product3  from "./../products/product-3.jpg"
 import  Product4  from "./../products/product-4.jpg"
 import  Product5  from "./../products/product-5.jpg"
 import  Product6  from "./../products/product-6.jpg"
 import  Product7  from "./../products/product-7.jpg"
 import  Product8  from "./../products/product-8.jpg"
 
 const Products = [
    {
        id:1,
        
        name: 'Pique Biker shoe',
        price:75,

    },

    {
        id:2,
        image:{Product2},
        name: 'Pique Biker Jacket',
        price:55,
        
    },

    {
        id:1,
        image:{Product3},
        name: 'Ankle Boots',
        price:60,
        
    },

    {
        id:1,
        image:{Product4},
        name: 'Classic Hoodies',
        price:70,
        
    },

    {
        id:1,
        image:{Product5},
        name: 'Cool T-shirt',
        price:40,
        
    },

    {
        id:1,
        image:{Product6},
        name: 'Blowing Scarf',
        price:80,
        
    },

    {
        id:1,
        image:{Product7},
        name: 'Leather Backpack',
        price:100,
        
    },

    {
        id:1,
        image:{Product8},
        name: 'T-shirt Contrast Pocket',
        price:150,
        path:'./..././'
        
    },
]

const ProReducer = ( state=Products, action) =>{
    switch(action.type){
        case "PRODUCT_LIST":
            return state;
        default: 
        return state;    

    }

}

export default ProReducer;
